import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import Home from './Home';
import Cart from './Cart';
import { CartProvider } from 'react-use-cart';


function App() {
  return (
      <>
        <CartProvider />
        <Home />
        <Cart />
      </>
  );
}

export default App;
